function NewBook() {
    return (
        <>
            <div className="search-holder">
            <div className="searchbox-add-button">
                <input type="text" className="searchbox" />
                <a href="/books/add" className="add-book-btn">Add Book</a>
            </div>
        </div>
        </>
    )
}

export default NewBook
